import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Layout from "./components/Layout";
import Articles from "./pages/Articles";
import Videos from "./pages/Videos";
import Profile from "./pages/Profile";
import UploadArticle from "./pages/UploadArticle";
import UploadVideo from "./pages/UploadVideo";
import Register from './pages/Register';
import Login from './pages/Login';

import Dashboard from './pages/Dashboard'; // ❗ JANGAN pakai kurung kurawal jika pakai export default


export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout><Articles /></Layout>} />
        <Route path="/articles" element={<Layout><Articles /></Layout>} />
        <Route path="/videos" element={<Layout><Videos /></Layout>} />
        <Route path="/profile" element={<Layout><Profile /></Layout>} />
        <Route path="/upload-article" element={<Layout><UploadArticle /></Layout>} />
        <Route path="/upload-video" element={<Layout><UploadVideo /></Layout>} />
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}
